import { useState } from 'react';
import './App.css';
import UserInput from './UserInput';
import UserOutput from './UserOutput';

function App() {

  const [userState,changeUserState] = useState({
    users:[
      {username:'Ouz', password:'1234'},
      {username:'Turan', password:'q1w2e3'}
    ]
  });

  const onChangeNameEvent = (event) => {

    changeUserState({
      users:[
        {username:'Oguzhan', password:'whatTheFantasticPass'},
        {username:event.target.value, password:'coolPassword1234'}
      ]
    });
  }

  const onChangePasswordEvent = (event) => {

    changeUserState({
      users:[
        {username:'Oguzhan', password:event.target.value},
        {username:'Turan', password:'coolPassword1234'}
      ]
    });
  }

  return (
    <div className="App">
      <header className="App-header">
        <p>Assignment-1</p>
      </header>
      <body>
        <UserInput changeNameEvent={onChangeNameEvent} changePasEvent={onChangePasswordEvent}/>
        <UserOutput username={userState.users[0].username} password={userState.users[0].password}/>
        <UserOutput username={userState.users[1].username} password={userState.users[1].password}/>
      </body>
    </div>
  );
}

export default App;
